import "./App.css";
import UmlItem from "./UmlItem";
function Umls(props) {




    return (

            <div>


                <div className="InputUml">
                    {props.items.map(umllist=><UmlItem id={umllist.id} olduml={umllist.olduml}/>)}
                    <label>input:</label>
                    <UmlItem
                    id={props.items[0].id}
                    olduml={props.items[0].olduml}
                     />

                </div>
            </div>

    )
        ;
}

export default Umls;
